<h2>
Predictor variables
</h2>

<h3>Description</h3>

<p>Get the names of the predictor variables for a region.
</p>


<h3>Usage</h3>

<pre><code class="language-R">disPredictors(region)
</code></pre>


<h3>Arguments</h3>

<table><tr style="vertical-align: top;">
<td><code>region</code></td>
<td>
<p>character. One of "AWT", "CAN", "NSW", "NZ", "SA", "SWI" </p>
</td>
</tr></table>
<h3>Value</h3>

<p>character vector
</p>


<h3>Examples</h3>

<pre><code class="language-R">disPredictors("NSW")
</code></pre>
